import React from 'react'
import style from './student.module.css'

function Student() {
  return (
    <div id={style.nav}>
        <ol>
            <li><a href="">Student Profile Creation</a></li>
            <li><a href="">Students Data</a></li>
        </ol>
    </div>
  )
}

export default Student
